import React from 'react';
import VideoPlayer from 'react-video-js-player';
import { pubImg } from '../../global/globalFunctions';

const ShooterGameMusic = props => {
    return (
        <VideoPlayer src={pubImg('ShooterGameMusic.mp4')} width={props.width}/>
    );
};

export default ShooterGameMusic;
